PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "user" ("id" INTEGER NOT NULL PRIMARY KEY, "username" VARCHAR(255) NOT NULL, "password" VARCHAR(255) NOT NULL, "user_type" VARCHAR(255) NOT NULL, "status" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "activation" ("id" INTEGER NOT NULL PRIMARY KEY, "user_id" INTEGER NOT NULL, "activation_type" INTEGER NOT NULL, "activation_start" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "activation_end" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "status" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY ("user_id") REFERENCES "user" ("id"));
CREATE TABLE IF NOT EXISTS "event" ("id" INTEGER NOT NULL PRIMARY KEY, "name" VARCHAR(255) NOT NULL, "eventDate" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "status" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "ticketdesign" ("id" INTEGER NOT NULL PRIMARY KEY, "name" VARCHAR(255) NOT NULL, "eventDate" DATETIME NOT NULL, "status" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "ticketprices" ("id" INTEGER NOT NULL PRIMARY KEY, "name" VARCHAR(255) NOT NULL, "base" REAL NOT NULL, "tax1" REAL NOT NULL, "tax2" REAL NOT NULL, "total" REAL NOT NULL, "ticket_type" INTEGER NOT NULL, "color" VARCHAR(255) NOT NULL, "design" TEXT NOT NULL, "bottomImage" TEXT NOT NULL, "topImage" TEXT NOT NULL, "status" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "reports" ("id" INTEGER NOT NULL PRIMARY KEY, "activation_id" INTEGER NOT NULL, "user_id" INTEGER NOT NULL, "report_type" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY ("activation_id") REFERENCES "activation" ("id"), FOREIGN KEY ("user_id") REFERENCES "user" ("id"));
CREATE TABLE IF NOT EXISTS "ticket" ("id" INTEGER NOT NULL PRIMARY KEY, "activation_id" INTEGER NOT NULL, "user_id" INTEGER NOT NULL, "transaction" VARCHAR(255) NOT NULL, "base" REAL NOT NULL, "tax1" REAL NOT NULL, "tax2" REAL NOT NULL, "total" REAL NOT NULL, "ticket_type" INTEGER NOT NULL, "activation_type" INTEGER NOT NULL, "ticket_price" INTEGER NOT NULL, "ticket_price_id" INTEGER NOT NULL, "ticket_count" INTEGER NOT NULL, "ticket_print_count" INTEGER NOT NULL, "status" INTEGER NOT NULL, "create_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, "update_at" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY ("activation_id") REFERENCES "activation" ("id"), FOREIGN KEY ("user_id") REFERENCES "user" ("id"), FOREIGN KEY ("ticket_price_id") REFERENCES "ticketprices" ("id"));
CREATE UNIQUE INDEX "user_username" ON "user" ("username");
CREATE INDEX "activation_user_id" ON "activation" ("user_id");
CREATE INDEX "reports_activation_id" ON "reports" ("activation_id");
CREATE INDEX "reports_user_id" ON "reports" ("user_id");
CREATE INDEX "ticket_activation_id" ON "ticket" ("activation_id");
CREATE INDEX "ticket_user_id" ON "ticket" ("user_id");
CREATE INDEX "ticket_ticket_price_id" ON "ticket" ("ticket_price_id");
COMMIT;
